import React, { Component } from 'react';
import styled from  'styled-components';
import { Link } from 'react-router-dom';

class Header extends Component {
    render() {
        return (
            <Container>
                <Element>
                    <ShortCut><Link to='/login'  style={{ textDecoration: 'none',color:'#c56183' }}>로그인</Link>/
                    <Link to='/join'  style={{ textDecoration: 'none',color:'#c56183' }}>회원가입</Link></ShortCut>
                        <Logo>
                           <img
                             width='100%'
                             height='100%'
                             src={process.env.PUBLIC_URL + 'img/logo.gif' } 
                             alt='logo'/>
                        </Logo>
                        <Search><h1>개발자 Seok</h1></Search>
                </Element>
            </Container>
        )
    }
}


export default Header;

const Container = styled.div`
    width: 100%;
    border-bottom: 1px solid #d1d8e4;
`

const Element = styled.div`
    margin: 0 auto;
    width: 1525px;
    height: 100px;
    display: flex;
    flex-flow: row wrap;
`

const ShortCut = styled.div`
    order: 1;
    width: 1520px;
    height: 20px;
    text-align: right;
    background-color: #e8ffff;
`

const Logo = styled.div`
    order: 2;
    width: 200px;
    height: 80px;
`

const Search = styled.div`
    order: 3;
    width: 1320px;
    height:80px;
    background-color: #d2f5e3;
    text-align: center;
`
